_parent.UpdateBigSmallState("技能中","瞬步斩结束");
//_parent.动画完毕();
_root.技能路由.动画完毕(this,_parent);

瞬步斩攻击 = _root.技能函数.瞬步斩攻击;

function 消弹()
{
	var 消弹属性 = _root.消弹属性初始化(this.攻击点);
	消弹属性.消弹方向 = _parent.方向 == "右" ? "左" : "右";
	消弹属性.Z轴攻击范围 = 30;
	消弹属性.区域定位area = this.攻击点;

	_root.消除子弹(消弹属性);
}

onClipEvent (enterFrame) {
	//第一段攻击必须位移
	_parent.攻击时可改变移动方向(25);
}

onClipEvent (enterFrame) {
	_parent.攻击时移动(0,25);
	_parent.攻击时可改变移动方向(0);
}

onClipEvent (enterFrame) {
	_parent.攻击时移动(0,25);
	_parent.攻击时可改变移动方向(0);
}

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{
		_parent.轻型武器攻击搓招();
	}
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 && !_parent.落地)
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
